import React, { Component } from "react";
import Navbar from "./components/Navbar";
import CVWorkingMode from "./components/CVWorkingMode";
import CVPreviewMode from "./components/CVPreviewMode";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstName: "",
    };

    this.handleChange = this.handleChange.bind(this);
    this.testFunction = this.testFunction.bind(this);
  }

  handleChange = (e) => {
    this.setState({
      firstName: e.target.value,
    });
    console.log(this.state.firstName);
  };

  testFunction() {
    console.log("test passed succesfully");
  }

  render() {
    return (
      <div className="h-screen">
        <Navbar />
        <div>
          <CVWorkingMode testFn={this.handleChange} />
          <CVPreviewMode testState={this.state.firstName} />
        </div>
      </div>
    );
  }
}

export default App;
